import React from 'react';

import { Route, Switch } from 'react-router-dom';
import Sidebar from '../Sidebar/Sidebar';
import Main from '../Main/Header';


const Layout = (props) => {
    return (
        <div className="wrapper">
            <Sidebar />
            <Main />
        </div>
    )
}

export default Layout ;
